import styled from "styled-components";

export const Title = styled.h1`
  color: ${({ theme }) => theme.colors.green.normal};
`;
export const Wrapper = styled.div`
  width: 100%;
  height: 100vh;
  background-color: gray;
  margin: auto auto;
`;
